import Link from 'next/link';
import Layout from '../components/Layout';
import 'bootstrap/dist/css/bootstrap.min.css';


export default () => (
    <Layout header="Next" title="Top page." >
        <div class="box27">
            <span class="box-title">ここにタイトル</span>
            <p>ここに文章</p>
        </div>
    </Layout>
);
